import './Books.css';
function Books(){
    return(
        <div className="main-div">

            <div className="box">
                <a href=""><img src="o auto da compadecida.jpg" alt="livro o auto da compadecida" className="book"/></a>
                <a href=""><h2>O Auto da Compadecida</h2></a>
            </div>

            <div className="box">
                <a href=""><img src="it.jpeg" alt="livro it: a coisa" className="book"/></a>
                <h2><a href="">It: a coisa</a></h2>
            </div>

            <div className="box">
                <a href=""><img src="a revolução dos bichos.jpg" alt="Livro a revolução dos bichos" className="book"/></a>
            </div>
        </div>
    );
}

export default Books;
